import React from 'react';
import {
Nav,
NavLink,
Bars,
NavMenu,
NavBtn,
NavBtnLink,
} from './NavBar';

const Navbar = () => {
return (
	<>
	<Nav>
		<Bars />

		<NavMenu>
		<h1>WhatsTheHaps?</h1>
		<NavLink to='/about' activeStyle>
			About
		</NavLink>

		<NavLink to='/terms' activeStyle>
			Terms and conditions
		</NavLink>

		</NavMenu>
		<NavBtn>
		<NavBtnLink to='/signin'>Sign In</NavBtnLink>
		</NavBtn>
	</Nav>
	</>
);
};

export default Navbar;
